/* eslint-disable @typescript-eslint/no-unused-vars */
/* eslint-disable react-native/no-inline-styles */
import React, {useState} from 'react';
import AntDesign from 'react-native-vector-icons/AntDesign';
import Ionicons from 'react-native-vector-icons/Ionicons';
import {
  SafeAreaView,
  ScrollView,
  TextInput,
  TouchableOpacity,
  View,
  Image,
  Text,
  StyleSheet,
} from 'react-native';
const AddSection_111 = () => {
  const data = [{rope: false}, {barbel: false}];
  const [isChoose, setIsChoose] = useState();
  function renderElement() {
    if (
      data.map(item => {
        item.isChoose = true;
      })
    ) {
      return <AntDesign name="checkcircleo" />;
    }
    return null;
  }
  return (
    <SafeAreaView style={styles.container}>
      <View
        style={{
          height: '6%',
          width: '100%',
          flexDirection: 'row',
          alignItems: 'center',
          justifyContent: 'space-between',
        }}>
        <TouchableOpacity
          style={{
            height: '100%',
            alignItems: 'center',
            flexDirection: 'row',
            paddingLeft: 10,
          }}
          onPress={() => {
            // navigation.goBack()
          }}>
          {/* <Image source={require('../asserts/icons/back-button.png')} style={{ flex: 1 }} resizeMode="contain" /> */}
          <Ionicons name="chevron-back" size={30} />
          <Text style={{fontSize: 20, paddingLeft: 10, fontWeight: '500'}}>
            Back
          </Text>
        </TouchableOpacity>
      </View>
      <View style={styles.body}>
        <Text style={{fontSize: 16, fontWeight: 'bold'}}>Tools in need</Text>
        <View style={styles.searchBox}>
          <TouchableOpacity onPress={() => {}}>
            <AntDesign
              name="search1"
              size={20}
              style={{marginHorizontal: 10, color: '#97B2FF'}}
            />
          </TouchableOpacity>
          <TextInput placeholder="Search..." />
        </View>
        <ScrollView style={{marginHorizontal: 10}}>
          <View
            style={{
              flexDirection: 'row',
              justifyContent: 'space-around',
              marginVertical: 30,
            }}>
            <TouchableOpacity
              style={{
                flexDirection: 'column',
                height: 150,
                alignItems: 'center',
                justifyContent: 'space-between',
              }}
              onPress={() => {}}>
              <Image
                source={require('../../asserts/images/rope.jpeg')}
                style={styles.image}
              />
              <Text style={{fontSize: 20, color: '#707070'}}>Rope</Text>
            </TouchableOpacity>
            <View
              style={{
                flexDirection: 'column',
                height: 150,
                alignItems: 'center',
                justifyContent: 'space-between',
              }}>
              <Image
                source={require('../../asserts/images/barbel.jpeg')}
                style={styles.image}
              />
              <Text style={{fontSize: 20, color: '#707070'}}>Barbel</Text>
            </View>
          </View>
          <View
            style={{
              flexDirection: 'row',
              justifyContent: 'space-around',
              marginVertical: 30,
            }}>
            <View
              style={{
                flexDirection: 'column',
                height: 150,
                alignItems: 'center',
                justifyContent: 'space-between',
              }}>
              <Image
                source={require('../../asserts/images/rope.jpeg')}
                style={styles.image}
              />
              <Text style={{fontSize: 20, color: '#707070'}}>Rope</Text>
            </View>
            <View
              style={{
                flexDirection: 'column',
                height: 150,
                alignItems: 'center',
                justifyContent: 'space-between',
              }}>
              <Image
                source={require('../../asserts/images/barbel.jpeg')}
                style={styles.image}
              />
              <Text style={{fontSize: 20, color: '#707070'}}>Rope</Text>
            </View>
          </View>
          <View
            style={{
              flexDirection: 'row',
              justifyContent: 'space-around',
              marginVertical: 30,
            }}>
            <View
              style={{
                flexDirection: 'column',
                height: 150,
                alignItems: 'center',
                justifyContent: 'space-between',
              }}>
              <Image
                source={require('../../asserts/images/rope.jpeg')}
                style={styles.image}
              />
              <Text style={{fontSize: 20, color: '#707070'}}>Rope</Text>
            </View>
            <View
              style={{
                flexDirection: 'column',
                height: 150,
                alignItems: 'center',
                justifyContent: 'space-between',
              }}>
              <Image
                source={require('../../asserts/images/barbel.jpeg')}
                style={styles.image}
              />
              <Text style={{fontSize: 20, color: '#707070'}}>Rope</Text>
            </View>
          </View>
        </ScrollView>
        <View style={{flex: 2, justifyContent: 'flex-end', bottom: 20}}>
          <View
            style={{
              flexDirection: 'row',
              justifyContent: 'space-around',
              marginBottom: 30,
            }}>
            <TouchableOpacity
              style={{
                backgroundColor: '#97B2FF',
                borderRadius: 35,
                height: 70,
                width: 120,
                flexDirection: 'row',
                alignItems: 'center',
                justifyContent: 'center',
              }}>
              <Text>Next</Text>
            </TouchableOpacity>
          </View>
        </View>
      </View>
    </SafeAreaView>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#FFFFFF',
  },
  searchBox: {
    borderWidth: 1,
    borderRadius: 10,
    borderColor: '#97B2FF',
    padding: 5,
    marginVertical: 10,
    flexDirection: 'row',
  },
  body: {
    margin: 30,
    flex: 8,
  },
  image: {
    borderRadius: 14,
    borderWidth: 1,
    borderColor: '#F1EDED',
    height: 114,
    width: 114,
    resizeMode: 'contain',
  },
});

export default AddSection_111;
